import React from 'react';
import ReactDOM from 'react-dom';

const IncNum = () =>{
    console.log("Clicked")
};

const App = () => {
    return(
        <>
            <h1>0</h1>
            <button onClick={IncNum}>Click Me</button>
        </>
    );
};

export default App;
